       this.ReportParameters.Expression = \"Concat([ClientName], \\\'; \\\', Format(Now(), \\\'MMMM d, yyyy\\\'))\";\r\n            this.ReportParameters.Name = \"ReportParameters\";\r\n            // \r\n            // ReportDescription\r\n            // \r\n            this.ReportDescription.DataMember = \"Clients\";\r\n            this.ReportDescription.Expression = \"\\\'Displays the patch compliance of your systems, and details each device and patch\" +\r\n                \" that is non-compliant.\\\'\";\r\n            this.ReportDescription.Name = \"ReportDescription\";\r\n            // \r\n            // ClientCompany\r\n            // \r\n            this.ClientCompany.DataMember = \"Clients\";\r\n            this.ClientCompany.Expression = \"Iif(IsNullOrEmpty([ClientCompanyName]), [ClientName], [ClientCompanyName])\";\r\n            this.ClientCompany.Name = \"ClientCompany\";\r\n            // \r\n            // PatchComplianceCalculation\r\n            // \r\n            this.PatchComplianceCalculation.DataMember = \"Clients.ClientPatchStats\";\r\n            this.PatchComplianceCalculation.Expression = \"Concat([ClientPatchesInstalled], \\\' Installed / \\\', [ClientPatchesApproved], \\\' Appr\" +\r\n                \"oved\\\')\";\r\n            this.PatchComplianceCalculation.Name = \"PatchComplianceCalculation\";\r\n            // \r\n            // ManagedAssetCount\r\n            // \r\n            this.ManagedAssetCount.DataMember = \"Clients.ClientPatchStats\";\r\n            this.ManagedAssetCount.Expression = \"Concat([ClientManagedWorkstations], \\\' Workstations \\\')\";\r\n            this.ManagedAssetCount.Name = \"ManagedAssetCount\";\r\n            // \r\n            // ComplianceGreenMin\r\n            // \r\n            this.ComplianceGreenMin.DataMember = \"Clients\";\r\n            this.ComplianceGreenMin.Expression = \"80\";\r\n            this.ComplianceGreenMin.Name = \"ComplianceGreenMin\";\r\n            // \r\n            // ComplianceYellowMin\r\n            // \r\n            this.ComplianceYellowMin.DataMember = \"Clients\";\r\n            this.ComplianceYellowMin.Expression = \"60.0\";\r\n            this.ComplianceYellowMin.Name = \"ComplianceYellowMin\";\r\n            // \r\n            // ClientCriticalCompliance\r\n            // \r\n            this.ClientCriticalCompliance.DataMember = \"Clients.ClientPatchStats\";\r\n            this.ClientCriticalCompliance.Expression = \"Round(([ClientCriticalInstalled] / [ClientCriticalApproved])*100)\";\r\n            this.ClientCriticalCompliance.FieldType = DevExpress.XtraReports.UI.FieldType.Double;\r\n            this.ClientCriticalCompliance.Name = \"ClientCriticalCompliance\";\r\n            // \r\n            // ClientImportantCompliance\r\n            // \r\n            this.ClientImportantCompliance.DataMember = \"Clients.ClientPatchStats\";\r\n            this.ClientImportantCompliance.Expression = \"Round(([ClientImportantInstalled] / [ClientImportantApproved])*100)\";\r\n            this.ClientImportantCompliance.FieldType = DevExpress.XtraReports.UI.FieldType.Double;\r\n            this.ClientImportantCompliance.Name = \"ClientImportantCompliance\";\r\n            // \r\n            // ClientModerateCompliance\r\n            // \r\n            this.ClientModerateCompliance.DataMember = \"Clients.ClientPatchStats\";\r\n            this.ClientModerateCompliance.Expression = \"Round(([ClientModerateInstalled] / [ClientModerateApproved])*100)\";\r\n            this.ClientModerateCompliance.FieldType = DevExpress.XtraReports.UI.FieldType.Double;\r\n            this.ClientModerateCompliance.Name = \"ClientModerateCompliance\";\r\n            // \r\n            // ClientLowCompliance\r\n            // \r\n            this.ClientLowCompliance.DataMember = \"Clients.ClientPatchStats\";\r\n            this.ClientLowCompliance.Expression = \"Round(([ClientLowInstalled]/[ClientLowApproved])*100)\";\r\n            this.ClientLowCompliance.Fi