g([PatchCompliance])\";\r\n            this.ClientPatchComplianceCalc.Name = \"ClientPatchComplianceCalc\";\r\n            // \r\n            // ClientPatchComplianceText\r\n            // \r\n            this.ClientPatchComplianceText.DataMember = \"Clients\";\r\n            this.ClientPatchComplianceText.Expression = \"Iif([ClientPatchProperties.ReportUseComputerComplianceCalculations] == \\\'True\\\', \\\'P\" +\r\n                \"atch Delivery Status\\\', \\\'Patch Compliance Calculation\\\')\";\r\n            this.ClientPatchComplianceText.Name = \"ClientPatchComplianceText\";\r\n            // \r\n            // ComputerFilterRow\r\n            // \r\n            this.ComputerFilterRow.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.ComputerFilterRow.Expression = \"Iif([Parameters.FilterShowDeviceType] == 1, Iif([PatchRiskStatus] != \\\'OK\\\', True, \" +\r\n                \"False), \\r\\nIif([Parameters.FilterShowDeviceType] == 2, Iif([PatchRiskStatus] == \\\'\" +\r\n                \"OK\\\', True, False), \\r\\nTrue))\";\r\n            this.ComputerFilterRow.FieldType = DevExpress.XtraReports.UI.FieldType.Boolean;\r\n            this.ComputerFilterRow.Name = \"ComputerFilterRow\";\r\n            // \r\n            // PatchDeviceHeaderText\r\n            // \r\n            this.PatchDeviceHeaderText.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchDeviceHeaderText.Expression = \"Iif([Parameters.FilterShowDeviceType] == 1, \\\'Non-Compliant Assets\\\', \\\'Managed Asse\" +\r\n                \"ts\\\')\";\r\n            this.PatchDeviceHeaderText.Name = \"PatchDeviceHeaderText\";\r\n            // \r\n            // PatchCountText\r\n            // \r\n            this.PatchCountText.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchCountText.Expression = \"Concat(Iif([PatchInstallCount] > 0, [PatchInstallCount], 0), \\\' / \\\', Iif([PatchNot\" +\r\n                \"AttemptedCount] > 0