inceLastCheckinDisplay\r\n            // \r\n            this.DaysSinceLastCheckinDisplay.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.DaysSinceLastCheckinDisplay.Expression = \"CONCAT(DateDiffDay([ComputerDateLastContact],NOW() ), \\\' Days\\\')\";\r\n            this.DaysSinceLastCheckinDisplay.Name = \"DaysSinceLastCheckinDisplay\";\r\n            // \r\n            // LastContactDisplay\r\n            // \r\n            this.LastContactDisplay.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.LastContactDisplay.Expression = \"Concat([ComputerDateLastContact],\\\'(\\\',DateDiffDay([ComputerDateLastContact],NOW())\" +\r\n                \",\\\' Days)\\\' )\";\r\n            this.LastContactDisplay.Name = \"LastContactDisplay\";\r\n            // \r\n            // ReleaseIDIfNull\r\n            // \r\n            this.ReleaseIDIfNull.DataMember = \"Clients.ComputerPatchCompliance.ComputerPatchCompliance_plugin_proval_windows_os_\" +\r\n                \"support\";\r\n            this.ReleaseIDIfNull.Expression = \"Iif(IsNullOrEmpty([ReleaseID]),\\\'N/A\\\' ,[ReleaseID] )\";\r\n            this.ReleaseIDIfNull.Name = \"ReleaseIDIfNull\";\r\n            // \r\n            // ComputerOSDisplay\r\n            // \r\n            this.ComputerOSDisplay.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.ComputerOSDisplay.Expression = resources.GetString(\"ComputerOSDisplay.Expression\");\r\n            this.ComputerOSDisplay.Name = \"ComputerOSDisplay\";\r\n            // \r\n            // ScriptLastRunDisp\r\n            // \r\n            this.ScriptLastRunDisp.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.ScriptLastRunDisp.Expression = resources.GetString(\"ScriptLastRunDisp.Expression\");\r\n            this.ScriptLastRunDisp.Name = \"ScriptLastRunDisp\";\r\n            // \r\n            // DaysSinceLastCheckin\r\n            // \r\n            this.DaysSinceLastCheckin.DataMemb