liance\";\r\n            this.PatchNotAttemptedCount.Expression = \"[PatchCvssHighNotAttemptedCount]+[PatchCvssMediumNotAttemptedCount]+[PatchCvssLow\" +\r\n                \"NotAttemptedCount]\";\r\n            this.PatchNotAttemptedCount.Name = \"PatchNotAttemptedCount\";\r\n            // \r\n            // PatchRiskCalc\r\n            // \r\n            this.PatchRiskCalc.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchRiskCalc.Expression = resources.GetString(\"PatchRiskCalc.Expression\");\r\n            this.PatchRiskCalc.Name = \"PatchRiskCalc\";\r\n            // \r\n            // PatchRiskStatus\r\n            // \r\n            this.PatchRiskStatus.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchRiskStatus.Expression = \"Iif(len([PatchRiskCalc]) > 0, [PatchRiskCalc], \\\'OK\\\')\";\r\n            this.PatchRiskStatus.Name = \"PatchRiskStatus\";\r\n            // \r\n            // PatchesNotInstalled\r\n            // \r\n            this.PatchesNotInstalled.DataMember = \"Clients.ClientPatchNoncompliance\";\r\n            this.PatchesNotInstalled.Expression = \"[PatchesFailed]+[PatchesNotAttemped]\";\r\n            this.PatchesNotInstalled.Name = \"PatchesNotInstalled\";\r\n            // \r\n            // ClientComputerCount\r\n            // \r\n            this.ClientComputerCount.DataMember = \"Clients\";\r\n            this.ClientComputerCount.Expression = \"[ComputerPatchCompliance].Count()\";\r\n            this.ClientComputerCount.Name = \"ClientComputerCount\";\r\n            // \r\n            // ClientPatchComplianceCalc\r\n            // \r\n            this.ClientPatchComplianceCalc.DataMember = \"Clients\";\r\n            this.ClientPatchComplianceCalc.Expression = \"[ComputerPatchCompliance][[^.ClientID] == [ClientID]].Avg([PatchCompliance])\";\r\n            this.ClientPatchComplianceCalc.Name = \"ClientPatchComplianceCalc\";\r\n            // \r\n            // ClientPatchComplianceText\r\n            // \r\n            this.ClientPatchComplianceText.DataMember = \"Clients\";\r\n            this.ClientPatchComplianceText.Expression = \"Iif([ClientPatchProperties.ReportUseComputerComplianceCalculations] == \\\'True\\\', \\\'P\" +\r\n                \"atch Delivery Status\\\', \\\'Patch Compliance Calculation\\\')\";\r\n            this.ClientPatchComplianceText.Name = \"ClientPatchComplianceText\";\r\n            // \r\n            // ComputerFilterRow\r\n            // \r\n            this.ComputerFilterRow.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.ComputerFilterRow.Expression = \"Iif([Parameters.FilterShowDeviceType] == 1, Iif([PatchRiskStatus] != \\\'OK\\\', True, \" +\r\n                \"False), \\r\\nIif([Parameters.FilterShowDeviceType] == 2, Iif([PatchRiskStatus] == \\\'\" +\r\n                \"OK\\\', True, False), \\r\\nTrue))\";\r\n            this.ComputerFilterRow.FieldType = DevExpress.XtraReports.UI.FieldType.Boolean;\r\n            this.ComputerFilterRow.Name = \"ComputerFilterRow\";\r\n            // \r\n            // PatchDeviceHeaderText\r\n            // \r\n            this.PatchDeviceHeaderText.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchDeviceHeaderText.Expression = \"Iif([Parameters.FilterShowDeviceType] == 1, \\\'Non-Compliant Assets\\\', \\\'Managed Asse\" +\r\n                \"ts\\\')\";\r\n            this.PatchDeviceHeaderText.Name = \"PatchDeviceHeaderText\";\r\n            // \r\n            // PatchCountText\r\n            // \r\n            this.PatchCountText.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.PatchCountText.Expression = \"Concat(Iif([PatchInstallCount] > 0, [PatchInstallCount], 0), \\\' / \\\', Iif([PatchNot\" +\r\n                \"AttemptedCount] > 0, [PatchNotAttemptedCount], 0), \\\' / \\\', Iif([PatchFailedCount]\" +\r\n                \" > 0, [PatchFailedCount], 0))\";\r\n            this.PatchCountText.Name = \"PatchCountText\";\r\n            // \r\n            // OSText\r\n            // \r\n            this.OSText.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.OSText.Expression = \"Iif([FullOSName]  Like \\\'%Virtual Desktops%\\\',\\\'Win 10 Ent Virt x64\\\'  ,[ComputerOS] \" +\r\n                \")\";\r\n            this.OSText.Name = \"OSText\";\r\n            // \r\n            // DaysSincePatch\r\n            // \r\n            this.DaysSincePatch.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.DaysSincePatch.Expression = \"Concat(DateDiffDay([ReleaseDate],NOW() ), \\\' Days\\\')\";\r\n            this.DaysSincePatch.Name = \"DaysSincePatch\";\r\n            // \r\n            // DateIfNull\r\n            // \r\n            this.DateIfNull.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.DateIfNull.Expression = \"Iif(IsNullOrEmpty([ReleaseDate]),\\\'N/A\\\' ,[ReleaseDate] )\";\r\n            this.DateIfNull.Name = \"DateIfNull\";\r\n            // \r\n            // OSBuildIfNull\r\n            // \r\n            this.OSBuildIfNull.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.OSBuildIfNull.Expression = \"Iif(IsNullOrEmpty([OSBuild]),\\\'N/A\\\' ,[OSBuild] )\";\r\n            this.OSBuildIfNull.Name = \"OSBuildIfNull\";\r\n            // \r\n            // DaySincePatchIfNull\r\n            // \r\n            this.DaySincePatchIfNull.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.DaySincePatchIfNull.Expression = \"CONCAT(Iif(IsNullOrEmpty([ReleaseDate]),\\\'N/A\\\' ,[DaysSincePatch] ), \\\' (\\\',Format([R\" +\r\n                \"eleaseDate], \\\'yyyy-MM\\\'),\\\') \\\')\";\r\n            this.DaySincePatchIfNull.Name = \"DaySincePatchIfNull\";\r\n            // \r\n            // DaysSinceLastCheckinDisplay\r\n            // \r\n            this.DaysSinceLastCheckinDisplay.DataMember = \"Clients.ComputerPatchCompliance\";\r\n            this.DaysSin